/* Add styles to the form container */
.container {
  position: sticky;
  left: 30px;
  top: 30px;
  margin: 20px;
  max-width: 300px;
  padding: 16px;
  background-color: black;
  
}

/* Full-width input fields */
input[type=text], input[type=password] {
  width: 100%;
  padding: 15px;
  margin: 5px 0 22px 0;
  border: none;
  background: #d4d4d4;
}

input[type=text]:focus, input[type=password]:focus {
  background-color: #ddd;
  outline: none;
}

/* Set a style for the submit button */
.btn {
  background-color: #d6d6d6;
  color:black;
  padding: 16px 20px;
  font-family: Qwigley;
  font-size: 30px;
  border: none;
  border-radius:8px;
  cursor: pointer;
  width: 100%;
  opacity: 0.9;
}

.btn:hover {
  opacity: 0.81;
}
